textOriginal:
Eduardo, vcs tao deixando de abordar um tema muito perigossímo: REAL DIGITAL
Em resumo será o confisco de todo dinheiro 2.0 muito melhor que o do Collor.
No real digital a pessoa só vai poder comprar aquilo que o governo permitir, o Caixa Tem já é assim já é um protótipo;
Com real digital a pessoa só poder usao o dinheiro depois de alguns dias como é no Caixa Tem;
Com real digital a pessoa vai ter um prazo pra usar o dinheiro e o quanto poderá usar;
O real digital terá prazo de  validade, se vc nao usar o dinheiro nesse prazo, o dinheiro vence. Assim nao vai ter como guardar dinheiro pra poupança;
Com o prazo de validade pro seu dinheiro nao vencer, vc se sentirá obrigado a comprar algum produto de banco tipo CDB, CDI, LCA etc e só vai poder usar o dinheiro depois do resgate depois de meses ou anos.
Com real digital a pessoa só vai poder comprar em locais onde empresários patrocinaram algum político aliado ao governo caso contrário vai dar 'transaçao nao autorizada'.
Isso tudo tem no próprio site do Banco Central.
